import React, { Component } from 'react';
import axios from 'axios';
class App extends Component {
constructor() {
super();
this.state = {
dataKu: [],
};
} 
componentDidMount(){
axios.get('https://jsonplaceholder.typicode.com/users')
.then((ambilData) => {
console.log(ambilData);
this.setState({
dataKu: ambilData.data,
})
})
};
render() {
  var css = {border:'1px solid black', padding:'12px'}
  const data = this.state.dataKu.map((item, index)=>{
  var id = item.id;
  var name = item.name;
  var mail = item.email;
  var alamat = [
  item.address.suite,
  item.address.street,
  item.address.city].join(", ");
  return <tr style={css} key={index}>
  <td style={css}>{id}</td>
  <td style={css}>{name}</td>
  <td style={css}>{mail}</td>
  <td style={css}>{alamat}</td>
  </tr>; 
  })
  return (
    <div><center>
    <h1>Coba Get Data</h1>
    <table style={css}>
    <tbody>
    <tr>
    <th>No</th>
    <th>Nama</th>
    <th>Email</th>
    <th>Alamat</th>
    </tr>
    { data }
    </tbody>
    </table>
    </center></div>
    );
    }}
    export default App;
